// SPDX-License-Identifier: MIT
pragma solidity 0.8.15;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./interfaces/IMasterChef.sol";
import "./interfaces/ISnacksStakingPool.sol";
import "./interfaces/ISnacks.sol";
import "./interfaces/IRouter.sol";
import "hardhat/console.sol";

contract Pulse is Ownable {
    using SafeERC20 for IERC20;
    
    uint256 constant private BASE_PERCENT = 10000;
    uint256 constant private TEN_PERCENT = 1000;
    uint256 constant private FIFTY_PERCENT = 5000;
    uint256 constant private SLIPPAGE_PERCENT = 9500;
    
    address public BUSD;
    address public CAKELP;
    address public ZOINKS;
    address public SNACKS;
    address public ETHSNACKS;
    address public BTCSNACKS;
    address public masterChef;
    address public snacksStakingPool;
    address public router;
    address public operator;
    
    modifier onlyOperator {
        require(
            msg.sender == operator,
            "Pulse: caller is not the operator"
        );
        _;
    }

    constructor(
        address _BUSD,
        address _router,
        address _operator
    )
    {
        require(
            _BUSD != address(0) &&
            _router != address(0) &&
            _operator != address(0),
            "Pulse: one of the addresses is zero"
        );
        BUSD = _BUSD;
        router = _router;
        operator = _operator;
        IERC20(BUSD).approve(router, type(uint256).max);
    }
    
    /*
    * @notice initialize contract or sets addresses in case of redeployment
    * @dev in the development phase, this function is used to reset addresses
    * TODO: add initilizer modificator
    */
    function initialize(
        address _CAKELP,
        address _ZOINKS,
        address _SNACKS,
        address _ETHSNACKS,
        address _BTCSNACKS,
        address _masterChef,
        address _snacksStakingPool
    )
        public
        onlyOwner
    {
        require(
            _CAKELP != address(0) &&
            _ZOINKS != address(0) &&
            _SNACKS != address(0) &&
            _BTCSNACKS != address(0) &&
            _ETHSNACKS != address(0) &&
            _masterChef != address(0) &&
            _snacksStakingPool != address(0),
            "Pulse: one of the addresses is zero"
        );
        CAKELP = _CAKELP;
        ZOINKS = _ZOINKS;
        SNACKS = _SNACKS;
        ETHSNACKS = _ETHSNACKS;
        BTCSNACKS = _BTCSNACKS;
        masterChef = _masterChef;
        snacksStakingPool = _snacksStakingPool;
        IERC20(CAKELP).approve(masterChef, type(uint256).max);
        IERC20(ZOINKS).approve(SNACKS, type(uint256).max);
        IERC20(ZOINKS).approve(router, type(uint256).max);
        IERC20(SNACKS).approve(snacksStakingPool, type(uint256).max);
    }
    
    /// @notice operates SNACKS
    function operateSNACKS() external onlyOperator {
        require(
            IERC20(SNACKS).balanceOf(address(this)) > 0,
            "Pulse: insufficient amount of SNACKS on the contract balance"
        );
        uint256 balance = IERC20(SNACKS).balanceOf(address(this));
        uint256 amountToOperate = balance * TEN_PERCENT / BASE_PERCENT;
        /// redeem 10% of the SNACKS balance
        ISnacks(SNACKS).redeem(amountToOperate);
        /// deposit 10% of the SNACKS balance to SNACKS staking pool
        ISnacksStakingPool(snacksStakingPool).deposit(amountToOperate);
    }
    
    /// @notice operates ZOINKS
    function operateZOINKS() external onlyOperator {
        require(
            IERC20(ZOINKS).balanceOf(address(this)) > 0,
            "Pulse: insufficient amount of ZOINKS on the contract balance"
        );
        uint256 balance = IERC20(ZOINKS).balanceOf(address(this));
        uint256 amountToOperate = balance * TEN_PERCENT / BASE_PERCENT;
        // buying SNACKS for 10% of the ZOINKS balance
        ISnacks(SNACKS).buyTotal(amountToOperate);
        // half of the 10% balance of ZOINKS changes to BUSD
        uint256 toBUSD = amountToOperate * FIFTY_PERCENT / BASE_PERCENT;
        address[] memory path = new address[](2);
        path[0] = ZOINKS;
        path[1] = BUSD;
        uint256[] memory amounts = IRouter(router).swapExactTokensForTokens(
            toBUSD,
            toBUSD * SLIPPAGE_PERCENT / BASE_PERCENT,
            path,
            address(this),
            block.timestamp + 15
        );
        // adding liquidity in the amount of 10% of the balance of ZOINKS
        (, , uint256 liquidity) = IRouter(router).addLiquidity(
            ZOINKS,
            BUSD,
            amounts[1],
            amounts[1],
            amounts[1] * SLIPPAGE_PERCENT / BASE_PERCENT,
            amounts[1] * SLIPPAGE_PERCENT / BASE_PERCENT,
            address(this),
            block.timestamp + 15
        );
        IMasterChef(masterChef).deposit(1, liquidity);
    }
    
    /// @notice claims reward from staking pools
    function harvest() external onlyOperator {
        IMasterChef(masterChef).withdraw(1);
        ISnacksStakingPool(snacksStakingPool).withdraw();
    }
    
    /// @notice sets the operator who is allowed to call the operating functions
    function setOperator(address _operator) external onlyOwner {
        require(
            _operator != address(0),
            "Pulse: attempt to assign a zero address"
        );
        operator = _operator;
    }
}
